import React from 'react';
import { Link } from 'react-router-dom';

const CuratorNavbar = () => (
  <nav>
    <ul>
      <li><Link to="/curator">Dashboard</Link></li>
      <li><Link to="/curator/exhibition-highlights">Exhibition Highlights</Link></li>
      <li><Link to="/curator/visitor-feedback">Visitor Feedback</Link></li>
      <li><Link to="/curator/artwork-insights">Artwork Insights</Link></li>
      <li><Link to="/curator/gallery-content-management">Gallery Content Management</Link></li>
      <li><Link to="/curator/manage-artworks1">Manage Artworks</Link></li>
      <li><Link to="/curator/organize-exhibition">Organize Exhibition</Link></li>
    </ul>
  </nav>
);

export default CuratorNavbar;
